<template>
  <div class="fixed-holder">
    <svg
      width="100%"
      height="100%"
      viewBox="0 0 603 731"
      version="1.1"
      xmlns="http://www.w3.org/2000/svg"
      xmlns:xlink="http://www.w3.org/1999/xlink"
      xml:space="preserve"
      xmlns:serif="http://www.serif.com/"
      style="fill-rule:evenodd;clip-rule:evenodd;stroke-linejoin:round;stroke-miterlimit:2;"
    >
      <g transform="matrix(1,0,0,1,-6617.29,-2854.45)">
        <g>
          <g transform="matrix(1.45113,0,0,1.45113,5792.24,2117.65)">
            <g transform="matrix(0.68912,-0,-0,0.68912,568.555,507.748)">
              <use
                xlink:href="#_CrystalImage1"
                x="5"
                y="423.663"
                width="592.411px"
                height="302.715px"
                transform="matrix(0.999007,0,0,0.999059,0,0)"
              />
            </g>
          </g>
          <g transform="matrix(1.45113,0,0,1.45113,5792.24,2117.65)">
            <g transform="matrix(0.68912,-0,-0,0.68912,568.555,507.748)">
              <use
                xlink:href="#_CrystalImage2"
                x="42"
                y="3"
                width="517.486px"
                height="522.47px"
                transform="matrix(0.999007,0,0,0.998987,0,0)"
              />
            </g>
          </g>
        </g>
      </g>
      <defs>
        <image
          id="_CrystalImage1"
          width="593px"
          height="303px"
          xlink:href="data:image/png;base64,"
        />
        <image
          id="_CrystalImage2"
          width="518px"
          height="523px"
          xlink:href="data:image/png;base64,"
        />
      </defs>
    </svg>
    <canvas ref="crystalCanvas" width="400" height="400"></canvas>
  </div>
</template>

<script>
import { mapState } from "vuex";
import Colors from "../assets/colors.json";

export default {
  data() {
    return {
      points: [],
    };
  },
  methods: {
    isInCircle(pos, radius) {
      const coords = { ...pos };
      if (coords.x > 170) {
        coords.x = coords.x + 80;
      }
      const width = Math.abs(200 - coords.x);
      const height = Math.abs(200 - coords.y);
      const distance = Math.sqrt(Math.pow(width, 2) + Math.pow(height, 2));
      return distance < radius;
    },
    createPoint(name, color) {
      let fillColor = hexToRgb(Colors[color].solid);
      fillColor = `rgba(${fillColor.r},${fillColor.g},${fillColor.b},0.8)`;
      this.points.push({
        name,
        color: fillColor,
        pos: { x: 200, y: 200 },
        velocity: {
          x: 2 * (Math.random() - 0.5),
          y: 2 * (Math.random() - 0.5),
        },
      });
    },
    animate() {
      const canvas = this.$refs.crystalCanvas;
      if (canvas) {
        const ctx = canvas.getContext("2d");
        ctx.clearRect(0, 0, canvas.width, canvas.height);

        this.points.forEach((point, index) => {
          if (!this.isInCircle(point.pos, 180)) {
            this.points[index].velocity.x =
              point.velocity.x * -1 + Math.random() - 0.5;
            this.points[index].velocity.y =
              point.velocity.y * -1 + Math.random() - 0.5;
          }

          if (!this.isInCircle(point.pos, 183)) {
            this.points[index].pos = { x: 200, y: 200 };
            this.points[index].velocity = {
              x: 2 * (Math.random() - 0.5),
              y: 2 * (Math.random() - 0.5),
            };
          }

          if (this.points[index].velocity.x > 3) {
            this.points[index].velocity.x = 2;
          }
          if (this.points[index].velocity.y > 3) {
            this.points[index].velocity.y = 2.5;
          }

          this.points[index].pos.x =
            point.pos.x + this.points[index].velocity.x;
          this.points[index].pos.y =
            point.pos.y + this.points[index].velocity.y;

          const finalPos = { ...this.points[index].pos };

          ctx.fillStyle = point.color;

          ctx.roundRect(finalPos.x, finalPos.y - 15, 80, 30, 30).fill();

          const font_size = point.name.length * -1 + 22;
          console.log(font_size)

          ctx.font = `${font_size}px EMcomic`;
          ctx.fillStyle = "black";
          ctx.textAlign = "center";
          ctx.fillText(
            point.name,
            finalPos.x + 40,
            finalPos.y + 5 - (font_size * -0.65 + 10)
          );
        });
        window.requestAnimationFrame(this.animate);
      }
    },
  },
  mounted() {
    window.requestAnimationFrame(this.animate);
    this.players.forEach((player) => {
      this.createPoint(player.name, player.team);
    });
  },
  computed: {
    ...mapState(["players"]),
  },
  watch: {
    players(newPlayers) {
      const newNames = newPlayers.map((x) => x.name);
      const oldNames = this.points.map((x) => x.name);

      const confirmedNewPlayers = newNames.filter((x) => !oldNames.includes(x));
      const confirmedOldPlayers = oldNames.filter((x) => !newNames.includes(x));

      confirmedNewPlayers.forEach((element) => {
        const index = newPlayers.findIndex((player) => player.name == element);
        const player = newPlayers[index];
        this.createPoint(player.name, player.team);
      });

      confirmedOldPlayers.forEach((element) => {
        const index = this.points.findIndex((player) => player.name == element);
        this.points.splice(index, 1);
      });
    },
  },
};

CanvasRenderingContext2D.prototype.roundRect = function(x, y, w, h, r) {
  if (w < 2 * r) r = w / 2;
  if (h < 2 * r) r = h / 2;
  this.beginPath();
  this.moveTo(x + r, y);
  this.arcTo(x + w, y, x + w, y + h, r);
  this.arcTo(x + w, y + h, x, y + h, r);
  this.arcTo(x, y + h, x, y, r);
  this.arcTo(x, y, x + w, y, r);
  this.closePath();
  return this;
};

function hexToRgb(hex) {
  var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
  return result
    ? {
        r: parseInt(result[1], 16),
        g: parseInt(result[2], 16),
        b: parseInt(result[3], 16),
      }
    : null;
}
</script>

